INSERT INTO us_companies VALUES(1,'Meta Platforms, Inc. Class A Common Stock','Meta is the largest social media company in the world, boasting close to 4 billion monthly active users worldwide. The firm''s "Family of Apps," its core business, consists of Facebook, Instagram, Messenger, and WhatsApp. End users can leverage these applications for a variety of different purposes, from keeping in touch with friends to following celebrities and running digital businesses for free. Meta packages customer data, gleaned from its application ecosystem and sells ads to digital advertisers. While the firm has been investing heavily in its Reality Labs business, it remains a very small part of Meta''s overall sales.','about.meta.com','META','7370','2012-05-18','650-543-4800',74067);
INSERT INTO us_companies VALUES(2,'Apple Inc.','Apple is among the largest companies in the world, with a broad portfolio of hardware and software products targeted at consumers and businesses. Apple''s iPhone makes up a majority of the firm sales, and Apple''s other products like Mac, iPad, and Watch are designed around the iPhone as the focal point of an expansive software ecosystem. Apple has progressively worked to add new applications, like streaming video, subscription bundles, and augmented reality. The firm designs its own software and semiconductors while working with subcontractors like Foxconn and TSMC to build its products and chips. Slightly less than half of Apple''s sales come directly through its flagship stores, with a majority of sales coming indirectly through partnerships and distribution.','apple.com','AAPL','3571','1980-12-12','(408) 996-1010',164000);
INSERT INTO us_companies VALUES(3,'Nvidia Corp','Nvidia is a leading developer of graphics processing units. Traditionally, GPUs were used to enhance the experience on computing platforms, most notably in gaming applications on PCs. GPU use cases have since emerged as important semiconductors used in artificial intelligence. Nvidia not only offers AI GPUs, but also a software platform, Cuda, used for AI model development and training. Nvidia is also expanding its data center networking solutions, helping to tie GPUs together to handle complex workloads.','nvidia.com','NVDA','3674','1999-01-22','408-486-2000',36000);
INSERT INTO us_companies VALUES(4,'Tesla, Inc. Common Stock','Tesla is a vertically integrated battery electric vehicle automaker and developer of autonomous driving software. The company has multiple vehicles in its fleet, which include luxury and midsize sedans, crossover SUVs, a light truck, and a semi truck. Tesla also plans to begin selling more affordable vehicles, a sports car, and offer a robotaxi service. Global deliveries in 2024 were a little below 1.8 million vehicles. The company sells batteries for stationary storage for residential and commercial properties including utilities and solar panels and solar roofs for energy generation. Tesla also owns a fast-charging network.','tesla.com','TSLA','3711','2010-06-29','650-681-5000',125665);
INSERT INTO us_companies VALUES(5,'Alphabet Inc. Class A Common Stock','Alphabet is a holding company that wholly owns internet giant Google. The California-based company derives slightly less than 90% of its revenue from Google services, the vast majority of which is advertising sales. Alongside online ads, Google services houses sales stemming from Google''s subscription services (YouTube TV, YouTube Music among others), platforms (sales and in-app purchases on Play Store), and devices (Chromebooks, Pixel smartphones, and smart home products such as Chromecast). Google''s cloud computing platform, or GCP, accounts for roughly 10% of Alphabet''s revenue with the firm''s investments in up-and-coming technologies such as self-driving cars (Waymo), health (Verily), and internet access (Google Fiber) making up the rest.','abc.xyz','GOOGL','7370','2004-08-19','650-253-0000',185719);
INSERT INTO us_companies VALUES(6,'Microsoft Corp','Microsoft develops and licenses consumer and enterprise software. It is known for its Windows operating systems and Office productivity suite. The company is organized into three equally sized broad segments: productivity and business processes (legacy Microsoft Office, cloud-based Office 365, Exchange, SharePoint, Skype, LinkedIn, Dynamics), intelligence cloud (infrastructure- and platform-as-a-service offerings Azure, Windows Server OS, SQL Server), and more personal computing (Windows Client, Xbox, Bing search, display advertising, and Surface laptops, tablets, and desktops).','microsoft.com','MSFT','7372','1986-03-13','425-882-8080',228000);
INSERT INTO us_companies VALUES(7,'Amazon.Com Inc','Amazon is the leading online retailer and marketplace for third party sellers. Retail related revenue represents approximately 75% of total, followed by Amazon Web Services'' cloud computing, storage, database, and other offerings (15%), advertising services (5% to 10%), and other the remainder. International segments constitute 25% to 30% of Amazon''s non-AWS sales, led by Germany, the United Kingdom, and Japan.','amazon.com','AMZN','5961','1997-05-15','(206) 266-1000',1556000);
INSERT INTO us_companies VALUES(8,'NetFlix Inc','Netflix''s relatively simple business model involves only one business, its streaming service. It has the biggest television entertainment subscriber base in both the United States and the collective international market, with more than 300 million subscribers globally. Netflix has exposure to nearly the entire global population outside of China. The firm has traditionally avoided a regular slate of live programming or sports content, instead focusing on on-demand access to episodic television, movies, and documentaries. The firm introduced ad-supported subscription plans in 2022, giving the firm exposure to the advertising market in addition to the subscription fees that have historically accounted for nearly all its revenue.','netflix.com','NFLX','7841','2002-05-23','408-540-3700',14000);
INSERT INTO us_companies VALUES(9,'Exxon Mobil Corporation','ExxonMobil is an integrated oil and gas company that explores for, produces, and refines oil worldwide. In 2023, it produced 2.4 million barrels of liquids and 7.7 billion cubic feet of natural gas per day. At the end of 2023, reserves were 16.9 billion barrels of oil equivalent, 66% of which were liquids. The company is one of the world''s largest refiners, with a total global refining capacity of 4.5 million barrels of oil per day, and is one of the world''s largest manufacturers of commodity and specialty chemicals.','exxonmobil.com','XOM','2911','1920-03-25','(972) 940-6000',60900);
INSERT INTO us_companies VALUES(10,'JPMorgan Chase & Co.','JPMorgan Chase is one of the largest and most complex financial institutions in the United States, with nearly $4 trillion in assets. It is organized into four major segments: consumer and community banking, corporate and investment banking, commercial banking, and asset and wealth management. JPMorgan operates, and is subject to regulation, in multiple countries.','jpmorganchase.com','JPM','6021','1969-03-05','(212) 270-6000',317233);
INSERT INTO us_companies VALUES(11,'VISA Inc.','Visa is the largest payment processor in the world. In fiscal 2023, it processed almost $15 trillion in total volume. Visa operates in over 200 countries and processes transactions in over 160 currencies. Its systems are capable of processing over 65,000 transactions per second.','usa.visa.com','V','7389','2008-03-19','650-432-3200',31600);
INSERT INTO us_companies VALUES(12,'Mastercard Incorporated','Mastercard is the second-largest payment processor in the world, having processed close to $10 trillion in volume during 2024. Mastercard operates in over 200 countries and processes transactions in over 150 currencies.','mastercard.com','MA','7389','2006-05-25','(914) 249-2000',35300);
INSERT INTO us_companies VALUES(13,'The Walt Disney Company','Disney operates in three global business segments: entertainment, sports, and experiences. Entertainment and experiences both benefit from the firm''s ownership of iconic franchises and characters. Entertainment includes the ABC broadcast network, several cable television networks, and the Disney+ and Hulu streaming services. Within the segment, Disney also engages in movie and television production and distribution, with content licensed to movie theaters, other content providers, or, increasingly, kept in-house for use on Disney''s own streaming platform and television networks. The sports segment houses ESPN and the ESPN+ streaming service. Experiences contains Disney''s theme parks and vacation destinations, and also benefits from merchandise licensing.','thewaltdisneycompany.com','DIS','7990','1962-01-02','(818) 560-1000',233000);
INSERT INTO us_companies VALUES(14,'PayPal Holdings, Inc. Common Stock','PayPal was spun off from eBay in 2015 and provides electronic payment solutions to merchants and consumers, with a focus on online transactions. The company had 434 million active accounts at the end of 2024. The company also owns Venmo, a person-to-person payment platform.','paypal.com','PYPL','7389','2015-07-20','(408) 967-1000',24400);
INSERT INTO us_companies VALUES(15,'Adobe Inc.','Adobe provides content creation, document management, and digital marketing and advertising software and services to creative professionals and marketers for creating, managing, delivering, measuring, optimizing, and engaging with compelling content multiple operating systems, devices, and media. The company operates with three segments: digital media content creation, digital experience for marketing solutions, and publishing for legacy products (less than 5% of revenue).','adobe.com','ADBE','7372','1986-08-20','(408) 536-6000',30709);
INSERT INTO us_companies VALUES(16,'Intel Corp','Intel is a leading digital chipmaker, focused on the design and manufacturing of microprocessors for the global personal computer and data center markets. Intel pioneered the x86 architecture for microprocessors and was the prime proponent of Moore''s law for advances in semiconductor manufacturing. Intel remains the market share leader in central processing units in both the PC and server end markets. Intel has also been expanding into new adjacencies, such as communications infrastructure, automotive, and the Internet of Things. Further, Intel expects to leverage its chip manufacturing capabilities into an outsourced foundry model where it constructs chips for others.','intel.com','INTC','3674','1971-10-13','(408) 765-8080',108900);
INSERT INTO us_companies VALUES(17,'Cisco Systems, Inc. Common Stock (DE)','Cisco Systems is the largest provider of networking equipment in the world and one of the largest software companies in the world. Its largest businesses are selling networking hardware and software (where it has leading market shares) and cybersecurity software such as firewalls. It also has collaboration products, like its Webex suite, and observability tools. It primarily outsources its manufacturing to third parties and has a large sales and marketing staff25,000 strong across 90 countries. Overall, Cisco employs 80,000 people and sells its products globally.','cisco.com','CSCO','3576','1990-02-16','(408) 526-4000',90400);
INSERT INTO us_companies VALUES(18,'Oracle Corp','Oracle provides enterprise applications and infrastructure offerings around the world through a variety of flexible IT deployment models, including on-premises, cloud-based, and hybrid. Founded in 1977, Oracle pioneered the first commercial SQL-based relational database management system, which is commonly used for running online transaction processing and data warehousing workloads. Besides database systems, Oracle also sells enterprise resource planning, or ERP, customer relationship management, or CRM, and human capital management, or HCM, applications. Today, Oracle has more than 159,000 full-time employees in over 170 countries.','oracle.com','ORCL','7372','1986-03-12','(737) 867-1000',159000);
INSERT INTO us_companies VALUES(19,'Palantir Technologies Inc. Class A Common Stock','Palantir is an analytical software company that focuses on leveraging data to create efficiencies in its clients'' organizations. The firm serves commercial and government clients via its Foundry and Gotham platforms, respectively. Palantir works only with entities in Western-allied nations and reserves the right not to work with anyone that is antithetical to Western values. The Denver-based company was founded in 2003 and went public in 2020.','palantir.com','PLTR','7372','2020-09-30','720-358-3679',4001);
INSERT INTO us_companies VALUES(20,'Evergy, Inc.','Evergy is a regulated electric utility serving eastern Kansas and western Missouri. Major operating subsidiaries include Evergy Metro, Evergy Kansas Central, Evergy Missouri West, and Evergy Transmission Co. The utility has a combined rate base of approximately $20 billion, about half in Kansas and the rest split between Missouri and federal jurisdiction. Evergy is one of the largest wind energy suppliers in the US.','evergy.com','EVRG','4931','1949-09-01','(816) 556-2200',4731);
INSERT INTO us_companies VALUES(21,'Coinbase Global, Inc. Class A Common Stock','Founded in 2012, Coinbase is the leading cryptocurrency exchange platform in the United States. The company intends to be the safe and regulation-compliant point of entry for retail investors and institutions into the cryptocurrency economy. Users can establish an account directly with the firm, instead of using an intermediary, and many choose to allow Coinbase to act as a custodian for their cryptocurrency, giving the company breadth beyond that of a traditional financial exchange. While the company still generates the majority of its revenue from transaction fees charged to its retail customers, Coinbase uses internal investment and acquisitions to expand into adjacent businesses, such as prime brokerage and data analytics.','coinbase.com','COIN','6199','2021-04-14','(302) 636-5401',3772);
INSERT INTO us_companies VALUES(22,'Taiwan Semiconductor Manufacturing Company Ltd.','Taiwan Semiconductor Manufacturing Co. is the world''s largest dedicated chip foundry, with mid-60s market share in 2024. TSMC was founded in 1987 as a joint venture of Philips, the government of Taiwan, and private investors. It went public in Taiwan in 1994 and as an ADR in the US in 1997. TSMC''s scale and high-quality technology allow the firm to generate solid operating margins, even in the highly competitive foundry business. Furthermore, the shift to the fabless business model has created tailwinds for TSMC. The foundry leader has an illustrious customer base, including Apple, AMD, and Nvidia, that looks to apply cutting-edge process technologies to its semiconductor designs. TSMC employs more than 73,000 people.','tsmc.com','TSM',NULL,'1997-10-08',NULL,83825);
INSERT INTO us_companies VALUES(23,'Advanced Micro Devices','Advanced Micro Devices designs a variety of digital semiconductors for markets such as PCs, gaming consoles, data centers, industrial, and automotive applications. AMD''s traditional strength was in central processing units and graphics processing units used in PCs and data centers. Additionally, the firm supplies the chips found in prominent game consoles such as the Sony PlayStation and Microsoft Xbox. In 2022, the firm acquired field-programmable gate array leader Xilinx to diversify its business and augment its opportunities in key end markets such as data center and automotive.','amd.com','AMD','3674','1979-10-15','(408) 749-4000',28000);
INSERT INTO us_companies VALUES(24,'Bilibili Inc. American Depositary Shares','Bilibili is a Chinese online entertainment platform best known for its YouTube-like video-sharing site. Founded in 2009, it initially focused on long-form content centered around anime, comics, and gaming, catering primarily to Gen Z users. Over time, the platform has broadened its content offerings to include a wider range of interests, successfully attracting a more diverse audience beyond the Gen Z demographic.','bilibili.com','BILI',NULL,'2018-03-28',NULL,8088);
INSERT INTO us_companies VALUES(25,'lululemon athletica inc.','Lululemon Athletica designs, distributes, and markets athletic apparel, footwear, and accessories for women, men, and girls. The company offers pants, shorts, tops, and jackets for both leisure and athletic activities such as yoga and running. Lululemon also sells fitness accessories, such as bags, yoga mats, and equipment. It sells its products through digital channels, a small number of wholesale partners, more than 760 company-owned stores in about two dozen countries in North America, Asia, and Western Europe, and about 40 franchised locations in the Middle East. The company was founded in 1998 and is based in Vancouver, Canada.','lululemon.com','LULU','2300','2007-07-27','604-732-6124',39000);
INSERT INTO us_companies VALUES(26,'JD.com, Inc.','JD.com is the third-largest Chinese e-commerce platform by GMV in 2024. it offers a wide selection of authentic products with speedy and reliable delivery. The company has built its own nationwide fulfilment infrastructure and last-mile delivery network, staffed by its own employees, which supports both its online direct sales, its online marketplace and omnichannel businesses.','jd.com','JD',NULL,'2014-05-22',NULL,668664);
INSERT INTO us_companies VALUES(27,'Broadcom Inc. Common Stock','Broadcom is the sixth-largest semiconductor company globally and has expanded into various software businesses, with over $30 billion in annual revenue. It sells 17 core semiconductor product lines across wireless, networking, broadband, storage, and industrial markets. It is primarily a fabless designer but holds some manufacturing in-house, like for its best-of-breed FBAR filters that sell into the Apple iPhone. In software, it sells virtualization, infrastructure, and security software to large enterprises, financial institutions, and governments.Broadcom is the product of consolidation. Its businesses are an amalgamation of former companies like legacy Broadcom and Avago Technologies in chips, as well as Brocade, CA Technologies, and Symantec in software.','broadcom.com','AVGO','3674','2009-08-06','650-427-6000',37000);
INSERT INTO us_companies VALUES(28,'AMERICAN RESOURCES CORP','American Resources Corp is a next-generation, environmentally, and socially responsible supplier of high-quality raw materials to the new infrastructure market. The firm is focused on the extraction and processing of metallurgical carbon, an essential ingredient used in steelmaking, critical and rare earth minerals for the electrification market, and reprocessed metal to be recycled. The firm has a growing portfolio of operations located in the Central Appalachian basin of eastern Kentucky and southern West Virginia where premium quality metallurgical carbon and rare earth mineral deposits are concentrated. Its business model provides a significant opportunity to scale its portfolio of assets to meet the growing global infrastructure and electrification markets.','americanresourcescorp.com','AREC','1220','2015-08-03','(317) 855-9926',26);
