PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE users (
		id VARCHAR NOT NULL,
		email VARCHAR,
		phone VARCHAR,
		username VARCHAR NOT NULL,
		password VARCHAR NOT NULL,
		first_name VARCHAR,
		last_name VARCHAR,
		date_of_birth DATE,
		is_google_user BOOLEAN,
		is_apple_user BOOLEAN,
		profile_img VARCHAR,
		PRIMARY KEY (id),
		UNIQUE (email),
		UNIQUE (phone),
		UNIQUE (username)
	);
CREATE TABLE currencies (
		symbol VARCHAR(20) NOT NULL,
		name VARCHAR(100),
		PRIMARY KEY (symbol)
	);
CREATE TABLE assets (
		id INTEGER NOT NULL,
		symbol VARCHAR(20) NOT NULL,
		name VARCHAR(100),
		type VARCHAR NOT NULL,
		cur_price FLOAT,
		last_updated DATETIME,
		PRIMARY KEY (id)
	);
CREATE TABLE sectors (
		code VARCHAR(10) NOT NULL,
		description VARCHAR(255),
		PRIMARY KEY (code)
	);
CREATE TABLE watchlist (
		id INTEGER NOT NULL,
		user_id VARCHAR NOT NULL,
		symbol VARCHAR NOT NULL,
		is_favorite BOOLEAN,
		PRIMARY KEY (id),
		CONSTRAINT unique_user_symbol UNIQUE (user_id, symbol),
		FOREIGN KEY (user_id) REFERENCES users (id),
		FOREIGN KEY (symbol) REFERENCES us_stocks (symbol)
	);
CREATE TABLE portfolio_history (
		id INTEGER NOT NULL,
		user_id VARCHAR NOT NULL,
		date DATE NOT NULL,
		total_value FLOAT NOT NULL,
		profit FLOAT NOT NULL,
		loss FLOAT NOT NULL,
		PRIMARY KEY (id),
		CONSTRAINT unique_user_date UNIQUE (user_id, date),
		FOREIGN KEY (user_id) REFERENCES users (id)
	);
CREATE TABLE intraday_us_market (
		id INTEGER NOT NULL,
		symbol VARCHAR(20),
		timestamp TIMESTAMP,
		multipler INTEGER,
		timespan VARCHAR(10),
		open FLOAT,
		close FLOAT,
		high FLOAT,
		low FLOAT,
		volume FLOAT,
		vwap FLOAT,
		transactions INTEGER,
		PRIMARY KEY (id),
		CONSTRAINT unique_intraday_data UNIQUE (symbol, timestamp, multipler, timespan),
		FOREIGN KEY (symbol) REFERENCES us_stocks (symbol)
	);
CREATE TABLE daily_us_market (
		id INTEGER NOT NULL,
		symbol VARCHAR(20),
		timestamp TIMESTAMP,
		open FLOAT,
		close FLOAT,
		high FLOAT,
		low FLOAT,
		volume FLOAT,
		vwap FLOAT,
		transactions INTEGER,
		PRIMARY KEY (id),
		CONSTRAINT unique_daily_data UNIQUE (symbol, timestamp),
		FOREIGN KEY (symbol) REFERENCES us_stocks (symbol)
	);
CREATE TABLE weekly_us_market (
		id INTEGER NOT NULL,
		symbol VARCHAR(20),
		timestamp TIMESTAMP,
		open FLOAT,
		close FLOAT,
		high FLOAT,
		low FLOAT,
		volume FLOAT,
		vwap FLOAT,
		transactions INTEGER,
		PRIMARY KEY (id),
		CONSTRAINT unique_weekly_data UNIQUE (symbol, timestamp),
		FOREIGN KEY (symbol) REFERENCES us_stocks (symbol)
	);
CREATE TABLE monthly_us_market (
		id INTEGER NOT NULL,
		symbol VARCHAR(20),
		timestamp TIMESTAMP,
		open FLOAT,
		close FLOAT,
		high FLOAT,
		low FLOAT,
		volume FLOAT,
		vwap FLOAT,
		transactions INTEGER,
		PRIMARY KEY (id),
		CONSTRAINT unique_monthly_data UNIQUE (symbol, timestamp),
		FOREIGN KEY (symbol) REFERENCES us_stocks (symbol)
	);
CREATE TABLE news (
		id VARCHAR(64) NOT NULL,
		company_id INTEGER NOT NULL,
		title VARCHAR(255) NOT NULL,
		description VARCHAR,
		article_url VARCHAR NOT NULL,
		image_url VARCHAR,
		published_utc DATE NOT NULL,
		author VARCHAR(100),
		publisher_name VARCHAR(100),
		publisher_homepage_url VARCHAR,
		publisher_logo_url VARCHAR,
		publisher_favicon_url VARCHAR,
		PRIMARY KEY (id),
		FOREIGN KEY (company_id) REFERENCES us_companies (id)
	);
CREATE TABLE IF NOT EXISTS "transactions" (
		id INTEGER NOT NULL,
		user_id INTEGER NOT NULL,
		asset_id INTEGER NOT NULL,
		amount FLOAT NOT NULL,
		price FLOAT NOT NULL,
		timestamp TIMESTAMP,
		type VARCHAR NOT NULL,
		status VARCHAR NOT NULL,
		PRIMARY KEY (id),
		CONSTRAINT unique_transaction UNIQUE (user_id, asset_id, timestamp),
		FOREIGN KEY (user_id) REFERENCES users (id),
		FOREIGN KEY (asset_id) REFERENCES assets (id)
	);
CREATE TABLE IF NOT EXISTS "us_companies" (
		id INTEGER NOT NULL,
		name VARCHAR(100) NOT NULL,
		description VARCHAR,
		domain VARCHAR(255),
		symbol VARCHAR(20) NOT NULL,
		sic_code VARCHAR(10),
		list_date DATE,
		phone_number VARCHAR,
		total_employees INTEGER,
		PRIMARY KEY (id),
		FOREIGN KEY (sic_code) REFERENCES sectors (code),
		FOREIGN KEY (symbol) REFERENCES us_stocks (symbol),
		UNIQUE (symbol)
	);
CREATE TABLE IF NOT EXISTS "us_stocks" (
		symbol VARCHAR(20) NOT NULL,
		active BOOLEAN NOT NULL,
		primary_exchange VARCHAR,
		market_cap FLOAT,
		weighted_shares_outstanding FLOAT,
		share_class_shares_outstanding FLOAT,
		PRIMARY KEY (symbol)
	);
CREATE TABLE IF NOT EXISTS "us_addresses" (
		id INTEGER NOT NULL,
		company_id INTEGER NOT NULL,
		address VARCHAR(255),
		city VARCHAR(100),
		post_code VARCHAR(20),
		state VARCHAR(100),
		PRIMARY KEY (id),
		CONSTRAINT company_post_code UNIQUE (company_id, post_code),
		FOREIGN KEY (company_id) REFERENCES us_companies (id)
	);
CREATE TABLE alembic_version (
		version_num VARCHAR(32) NOT NULL,
		CONSTRAINT alembic_version_pkc PRIMARY KEY (version_num)
	);
CREATE TABLE IF NOT EXISTS "balances" (
		id INTEGER NOT NULL,
		user_id VARCHAR NOT NULL,
		currency VARCHAR(20) NOT NULL,
		amount FLOAT NOT NULL,
		PRIMARY KEY (id),
		CONSTRAINT unique_user_currency UNIQUE (user_id, currency),
		FOREIGN KEY (currency) REFERENCES currencies (symbol),
		FOREIGN KEY (user_id) REFERENCES users (id)
	);
CREATE TABLE portfolio (
	id INTEGER NOT NULL, 
	user_id VARCHAR NOT NULL, 
	symbol VARCHAR NOT NULL, 
	quantity FLOAT NOT NULL, 
	avg_cost FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(symbol) REFERENCES us_stocks (symbol), 
	FOREIGN KEY(user_id) REFERENCES users (id), 
	CONSTRAINT unique_user_portfolio UNIQUE (user_id, symbol)
);
CREATE TABLE messages (
	id INTEGER NOT NULL, 
	sender_id VARCHAR NOT NULL, 
	receiver_id VARCHAR NOT NULL, 
	message VARCHAR NOT NULL, 
	type VARCHAR NOT NULL, 
	timestamp TIMESTAMP, 
	is_read BOOLEAN, 
	is_sender_deleted BOOLEAN, 
	is_receiver_deleted BOOLEAN, 
	PRIMARY KEY (id), 
	FOREIGN KEY(receiver_id) REFERENCES users (id), 
	FOREIGN KEY(sender_id) REFERENCES users (id)
);
CREATE TABLE IF NOT EXISTS "financials" (
	id INTEGER NOT NULL, 
	cik VARCHAR(20), 
	symbol VARCHAR(20) NOT NULL, 
	type VARCHAR(10) NOT NULL, 
	sub_type VARCHAR(10) NOT NULL, 
	value INTEGER NOT NULL, 
	unit VARCHAR(10), 
	labal VARCHAR(100) NOT NULL, 
	"order" INTEGER NOT NULL, 
	company_id INTEGER NOT NULL, 
	fiscal_year INTEGER NOT NULL, 
	fiscal_period VARCHAR(10) NOT NULL, 
	start_date DATE NOT NULL, 
	end_date DATE NOT NULL, 
	PRIMARY KEY (id), 
	CONSTRAINT unique_financials UNIQUE (company_id, fiscal_year, fiscal_period, type, sub_type), 
	CONSTRAINT fk_financials_symbol FOREIGN KEY(symbol) REFERENCES us_stocks (symbol), 
	FOREIGN KEY(company_id) REFERENCES us_companies (id)
);
COMMIT;
